import React, { useState } from "react";
import axios from "axios";

export default function Dictionary() {
  const [keyword, setKeyword] = useState("");
  const [result, setResult] = useState(null);
  const [photos, setPhotos] = useState([]);

  function handleResponse(response) {
    setResult(response.data);
  }

  function handlePhotoResponse(response) {
    setPhotos(response.data.photos);
  }

  function search(event) {
    event.preventDefault();

    const dictionaryApiKey = process.env.REACT_APP_SHECODES_API_KEY;
    const dictionaryApiUrl = `https://api.shecodes.io/dictionary/v1/define?word=${keyword}&key=${dictionaryApiKey}`;
    axios.get(dictionaryApiUrl).then(handleResponse);

    const pexelsApiKey =
      "T0JsUooWXK3uJKTgr56reX6nc59YwDsxVivjT9cTyW25s9klWz4DO2wn";
    const pexelsApiUrl = `https://api.pexels.com/v1/search?query=${keyword}&per_page=6`;
    axios
      .get(pexelsApiUrl, {
        headers: { Authorization: pexelsApiKey },
      })
      .then(handlePhotoResponse);
  }

  function handleKeywordChange(event) {
    setKeyword(event.target.value);
  }

  const adjectives = result?.meanings?.filter(
    (m) => m.partOfSpeech === "adjective"
  );
  const nouns = result?.meanings?.filter((m) => m.partOfSpeech === "noun");
  const synonyms = result?.meanings
    ?.flatMap((m) => m.definitions || [])
    .flatMap((d) => d.synonyms || []);

  return (
    <div className="container py-5">
      <h1 className="text-center mb-4">Dictionary App</h1>
      <form onSubmit={search} className="input-group mb-5">
        <input
          type="search"
          onChange={handleKeywordChange}
          placeholder="Search for a word"
          className="form-control"
        />
        <button type="submit" className="btn btn-primary">
          Search
        </button>
      </form>

      {result && (
        <div className="row gy-4">
          <div className="col-12">
            <div className="card p-3 shadow-sm">
              <h2 className="mb-1">{result.word}</h2>
              <p className="text-muted">
                <em>{result.phonetic}</em>
              </p>
            </div>
          </div>

          {adjectives?.length > 0 && (
            <div className="col-md-6">
              <div className="card p-3 shadow-sm">
                <h4 className="text-primary">Adjectives</h4>
                <ul>
                  {adjectives.map((m, index) =>
                    m.definitions.map((d, i) => (
                      <li key={`${index}-${i}`}>{d.definition}</li>
                    ))
                  )}
                </ul>
              </div>
            </div>
          )}

          {nouns?.length > 0 && (
            <div className="col-md-6">
              <div className="card p-3 shadow-sm">
                <h4 className="text-success">Nouns</h4>
                <ul>
                  {nouns.map((m, index) =>
                    m.definitions.map((d, i) => (
                      <li key={`${index}-${i}`}>{d.definition}</li>
                    ))
                  )}
                </ul>
              </div>
            </div>
          )}

          {synonyms?.length > 0 && (
            <div className="col-12">
              <div className="card p-3 shadow-sm">
                <h4 className="text-warning">Synonyms</h4>
                <p>{[...new Set(synonyms)].join(", ")}</p>
              </div>
            </div>
          )}

          {photos?.length > 0 && (
            <div className="col-12">
              <div className="card p-3 shadow-sm">
                <h4 className="text-info">Images from Pexels</h4>
                <div className="row">
                  {photos.map((photo) => (
                    <div className="col-4 mb-3" key={photo.id}>
                      <a href={photo.url} target="_blank" rel="noreferrer">
                        <img
                          src={photo.src.medium}
                          alt={photo.photographer}
                          className="img-fluid rounded"
                        />
                      </a>
                      <small className="d-block text-muted mt-1">
                        Â© {photo.photographer}
                      </small>
                    </div>
                  ))}
                </div>
              </div>
            </div>
          )}
        </div>
      )}
    </div>
  );
}
